import React from 'react'
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
function Reviewme() {
    return (
        <div className='fw-bold h3'>
            <nav className='d-flex flex-column justify-content-evenly  text-dark font-bold topbar ' style={{ height: "80px" }}>
                <div className='d-flex flex-row justify-content-evently bg-primary'>
                    <h1>KarakaFamilyHealth</h1>
                    <Link to="/" className='nav-link'>Home</Link>
                </div>
            </nav>
            Review Me
        </div>
    )
}

export default Reviewme
